import { ADD_WINNERS_BY_WEEK, MAIL_WINNERS } from '../Actions/winnerActions';


const initialState =[]

export default (state = initialState, action) => {
    switch (action.type) {
        case MAIL_WINNERS:
            return [...state, {
                date:new Date(),
                winners: action.payload.emails
            }]
        default:
        return state;
    }
  }
